import api from "../../../API/Api";

const addPreshipmentFacility = (data, CompanyId) => {
  return api.post(
    `/CreditFacilityUtilization/${CompanyId}/PreShipmentFacility`,
    data,
    {
      headers: {
        Authorization: `bearer ${localStorage.getItem("token")}`,
        "Content-Type": "application/json",
      },
    }
  );
};

const getAllPreshipmentByUtilizationId = (Id) => {
  return api.get(`/CreditFacilityUtilization/${Id}/PreShipmentFacility`, {
    headers: {
      Authorization: `bearer ${localStorage.getItem("token")}`,
      "Content-Type": "application/json",
    },
  });
};
const getpreshipmentFacilityById = (Id) => {
  return api.get(`/CreditFacilityUtilization/PreShipmentFacility/${Id}`, {
    headers: {
      Authorization: `bearer ${localStorage.getItem("token")}`,
      "Content-Type": "application/json",
    },
  });
};
const deletepreshipmentFacilityById = (CompanyId) => {
  return api.delete(
    `/CreditFacilityUtilization/PreShipmentFacility/${CompanyId}`,
    {
      headers: {
        Authorization: `bearer ${localStorage.getItem("token")}`,
        "Content-Type": "application/json",
      },
    }
  );
};
const updatePreshipmentFacilityById = (Id, data) => {
  return api.put(`/CreditFacilityUtilization/PreShipmentFacility/${Id}`, data, {
    headers: {
      Authorization: `bearer ${localStorage.getItem("token")}`,
      "Content-Type": "application/json",
    },
  });
};
const PreshipmentFacilityService = {
  addPreshipmentFacility,
  deletepreshipmentFacilityById,
  getpreshipmentFacilityById,
  updatePreshipmentFacilityById,
  getAllPreshipmentByUtilizationId,
};
export default PreshipmentFacilityService;
